class Solution {
public:
    int maxProduct(int A[], int n) {
    	int *arr = (int *)malloc(sizeof(int) * n * n);
    	
    	for (int i = 0; i < n; i++) arr[i * n + i] = A[i];
    	int max_product = INT_MIN;
    	for (int step = 1; step < n; step++) {
    		for (int i = 0; i < n - step; i++) 
    		{
    			int j = i + step;
    			int product = arr[i * n + j - 1] * A[j];
    			arr[i * n + j] = product;
    			if (product > max_product) max_product = product; 
     		}
    	}
//    	int max_i = 0, max_j = 0;
//    	printf("%d,%d\n",max_i,max_j);
    	free(arr);
    	return max_product;
    }
};

